import React from 'react';
import styled from "styled-components";

const Container = styled("figure")`

margin:auto;
`;
const Caption = styled("figcaption")`

`;

const Image = styled("img")`
width: 560px;
height: 319px;
`;


const Quote = ({ image }) => {
    return (
        <>
            <Container>
                <Image src={image.url} />
                <Caption>{image.caption}</Caption>
            </Container>
        </>
    );
}

export default Quote;
